  records: 
  - - 1
    - test
    - ! "<div class=\"cnt\">\r\n<p style=\"margin-top:0px;\">\r\n                    <b
      class=\"boldTxt\">Important information for corporate / business sellers regarding
      returns</b>\r\n                  </p>\r\n                  <p style=\"\">Corporate
      / business sellers may be obliged to accept returns in certain circumstances
      under Australian law, as described below. &nbsp;</p>\r\n                  <p
      style=\"margin-bottom: 0px;\">Under the Trade Practices Act 1974 and state fair
      trading legislation, your return policy must allow a refund to a buyer if the
      consumer goods you sold:</p>\r\n                  <ul style=\"margin-top: 6px;\">\r\n
      \                   <li class=\"unorderedList\">\r\n                      <div
      style=\"padding-left:4px;\">\r\n                        <p style=\"\">are or
      become defective through no fault of the buyer;</p>\r\n                      </div>\r\n
      \                   </li>\r\n                    <li class=\"unorderedList\">\r\n
      \                     <div style=\"padding-left:4px;\">\r\n                        <p
      style=\"\">are not for the purpose you stated or the purpose the buyer made
      known to you;</p>\r\n                      </div>\r\n                    </li>\r\n
      \                   <li class=\"unorderedList\">\r\n                      <div
      style=\"padding-left:4px;\">\r\n                        <p style=\"\">don’t
      match your description or sample; or</p>\r\n                      </div>\r\n
      \                   </li>\r\n                    <li class=\"unorderedList\">\r\n
      \                     <div style=\"padding-left:4px;\">\r\n                        <p
      style=\"\">have defects that were not obvious or that you did not bring to the
      buyer's attention.</p>\r\n                      </div>\r\n                    </li>\r\n
      \                 </ul>\r\n                  <p style=\"\">When a product does
      not meet the above requirements, the buyer can ask for a refund within a reasonable
      period of time. There is no set time limit for a buyer to obtain a refund. You
      can ask a buyer for proof of purchase. You can also ask them to demonstrate
      that any problem with the goods was not their fault.</p>\r\n                  <p
      style=\"\">\r\n                    <b class=\"boldTxt\">Note:</b>\r\n                    Even
      though eBay provides the ability for sellers to state a time limit in their
      return policy, business sellers should\r\n                    <b class=\"boldTxt\">not</b>\r\n
      \                   do so as applicable legislation overrides any conditions
      you may state in your listing. Furthermore, you could be seen as misleading
      buyers about their rights. For example, if your policy states ' No refunds after
      7 days’ this may mislead consumers about their rights under applicable legislation.\r\n
      \                 </p>\r\n                  <p style=\"\">If the buyer prefers,
      you may arrange for goods to be exchanged or repaired, or offer credit (at your
      discretion).</p>\r\n                  <p style=\"\">You are not required to
      offer a refund if the buyer simply changes their mind. You should therefore
      encourage buyers to choose carefully.</p>\r\n                  <p style=\"\">For
      more information about warranties and refunds contact the ACCC Infocentre on
      1300 302 502 or visit the ACCC website at www.accc.gov.au.&nbsp;</p>\r\n                  <p
      style=\"\">The above information is general in nature and is not intended to
      constitute legal advice.&nbsp; For advice specific to your circumstances, eBay
      recommends that you consult with a legal advisor.</p>\r\n                  <p
      style=\"\">\r\n                    <b class=\"boldTxt\">Important information
      for buyers: legal rights to obtain refunds</b>\r\n                  </p>\r\n
      \                 <p style=\"\">As described above, when consumer goods are
      purchased  from sellers carrying on a business, the buyer has a legal right
      to return the goods to the seller and obtain a refund if the goods are either
      faulty, not fit for their purpose (don't do what they are supposed to do), or
      do not match the seller's description or sample. To obtain a refund the buyer
      should return the goods within a reasonable time and not dispose of, lose, destroy
      or damage the goods.&nbsp;</p>\r\n                  <p style=\"\">\r\n                    The\r\n
      \                   <a href=\"www.accc.gov.au\" target=\"_blank\">Australian
      Competition and Consumer Commission website</a>\r\n                    <a href=\"http://www.accc.gov.au\"></a>contains\r\n
      \                   more information on rights to refunds, under the section
      headed “Publications”.\r\n                  </p>\r\n                  <p style=\"\">\r\n
      \                   <b class=\"boldTxt\">A clear return policy can reassure
      buyers</b>\r\n                  </p>\r\n                  <p style=\"\">Even
      if you are not required by law to provide returns to your buyers, there are
      other good reasons for doing so.&nbsp;If you have a clear return policy, chances
      are you're more successful than other sellers on eBay. eBay’s research shows
      that difficulty in returning items is the most common shopping barrier for buyers.
      So if you clearly spell out return policies in your listings you'll have an
      edge on the competition.</p>\r\n                  <p style=\"\">eBay’s research
      also shows that only a very small percentage of sold items are actually returned.</p>\r\n
      \                 <p style=\"margin-bottom: 0px;\">\r\n                    <b
      class=\"boldTxt\">Return policy options to consider:</b>\r\n                  </p>\r\n
      \                 <ul style=\"margin-top: 6px;\">\r\n                    <li
      class=\"unorderedList\">\r\n                      <div style=\"padding-left:4px;\">\r\n
      \                       <p style=\"\"><b class=\"boldTxt\">Refund</b>(for example,
      returns accepted for full money back or store credit if goods are faulty).\r\n
      \                       </p>\r\n                      </div>\r\n                    </li>\r\n
      \                   <li class=\"unorderedList\">\r\n                      <div
      style=\"padding-left:4px;\">\r\n                        <p style=\"\"><b class=\"boldTxt\">100%
      satisfaction guaranteed</b>(for example, returns accepted, no questions asked.
      Make sure you are prepared to do this).\r\n                        </p>\r\n
      \                     </div>\r\n                    </li>\r\n                    <li
      class=\"unorderedList\">\r\n                      <div style=\"padding-left:4px;\">\r\n
      \                       <p style=\"\"><b class=\"boldTxt\">Time limit</b>(for
      example, returns accepted within a reasonable time after the item is delivered).\r\n
      \                       </p>\r\n                      </div>\r\n                    </li>\r\n
      \                 </ul>\r\n                  <p style=\"\">\r\n                    <b
      class=\"boldTxt\">Mention the details up front</b>\r\n                  </p>\r\n
      \                 <p style=\"margin-bottom: 0px;\">Consider including details
      like the following to make your return policy clear and complete:</p>\r\n                  <ul
      style=\"margin-top: 6px;\">\r\n                    <li class=\"unorderedList\">\r\n
      \                     <div style=\"padding-left:4px;\">\r\n                        <p
      style=\"\"><b class=\"boldTxt\">Postage and handling charges:</b>Clearly state
      who would pay for return postage and handling, you or the buyer and if you will
      refund the original postage charges.\r\n                        </p>\r\n                      </div>\r\n
      \                   </li>\r\n                    <li class=\"unorderedList\">\r\n
      \                     <div style=\"padding-left:4px;\">\r\n                        <p
      style=\"\"><b class=\"boldTxt\">Item condition:</b>Clearly state the condition
      of the returned item that would be acceptable to you, for example, \"unopened
      box\" or \"opened box with all original materials.\"\r\n                        </p>\r\n
      \                     </div>\r\n                    </li>\r\n                  </ul>\r\n
      \                 <p style=\"\">\r\n                    <b class=\"boldTxt\">How
      to specify your return policy</b>\r\n                  </p>\r\n                  <p
      style=\"margin-bottom: 0px;\">In the Additional Information section of the Sell
      Your Item form, take the following steps:</p>\r\n                  <ul style=\"margin-top:
      6px;\">\r\n                    <li class=\"unorderedList\">\r\n                      <div
      style=\"padding-left:4px;\">\r\n                        <p style=\"\">Select
      \"Returns accepted\"</p>\r\n                      </div>\r\n                    </li>\r\n
      \                   <li class=\"unorderedList\">\r\n                      <div
      style=\"padding-left:4px;\">\r\n                        <p style=\"\">Select
      the time limit within which the buyer must return the item to you.</p>\r\n                      </div>\r\n
      \                   </li>\r\n                    <li class=\"unorderedList\">\r\n
      \                     <div style=\"padding-left:4px;\">\r\n                        <p
      style=\"\">Select the type of refund you will give if the item is returned.</p>\r\n
      \                     </div>\r\n                    </li>\r\n                    <li
      class=\"unorderedList\">\r\n                      <div style=\"padding-left:4px;\">\r\n
      \                       <p style=\"\">Enter all other details about your return
      policy in the Return Policy Details text box.</p>\r\n                      </div>\r\n
      \                   </li>\r\n                  </ul>\r\n</div>"
    - 2012-04-22 09:10:16.000000000Z
    - 2012-04-22 09:10:16.000000000Z

